                  />
                </div>
              </div>

              <div className="search-container">
                <div className="search-input-wrapper">
                  <span className="search-icon">ðŸ”</span>
                  <input
                    type="text"
                    placeholder="Search by Party Name..."
                    value={materialFilters.partyName}
                    onChange={(e) => handleMaterialFilterChange("partyName", e.target.value)}
                    className="enhanced-search-input"
                  />
                  {materialFilters.partyName && (
                    <button className="clear-search-btn" onClick={() => handleMaterialFilterChange("partyName", "")}>
                      âœ•
                    </button>
                  )}
                </div>
              </div>
            </div>

            <div className="filter-row">
              <div className="custom-select-wrapper">
                <label className="select-label">ðŸ—ï¸ Grade</label>
                <div className="custom-select">
                  <select
                    value={materialFilters.grade}
