                  </select>
                  <span className="select-arrow">â–¼</span>
                </div>
              </div>
            </div>

            <div className="filter-actions-row">
              <button className="btn btn-clear-all" onClick={clearMaterialFilters}>
                ðŸ—‘ï¸ Clear Material Filters
              </button>
              <div className="filter-summary">
                <span className="results-badge">
                  ðŸ“Š {filteredMaterialData.length} of {materialData.length} records
                </span>
              </div>
            </div>
          </div>
        </div>

        <div className="concrete-delivery-table">
          <table>
            <thead>
              <tr>
                <th>S.No</th>
                <th>Date</th>
                <th>Party Name</th>
                <th>P/B</th>
                <th>Grade</th>
                <th>Qty</th>
