                  </td>
                  <td>
                    <span className="grade-badge">{item.grade}</span>
                  </td>
                  <td className="qty-cell">{item.qty}</td>
                  <td className="rate-cell">â‚¹{item.rate.toLocaleString()}</td>
                  <td>{item.billNo}</td>
